import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import ExpansionPanelDetails from '@material-ui/core/ExpansionPanelDetails';
import TournamentDetails from '../TournamentsListItemDetail/TournamentDetails/TournamentDetails';
import SeriesDetails from '../TournamentsListItemDetail/SeriesDetails/SeriesDetails';

const panelDetailsStyles = makeStyles((theme) => ({
	root: {
		width: '100%'
	},
	details: {
		alignItems: 'center'
	},
	column: {
		flexBasis: '50%'
	}
}));

const TournamentsListItemDetail = (props) => {
	const panelDetailClasses = panelDetailsStyles();

	return (
		<div className={panelDetailClasses.root}>
			<ExpansionPanelDetails className={panelDetailClasses.details}>
				<div className={panelDetailClasses.column}>
					<TournamentDetails tournamentDetails={props.tournamentDetails} />
				</div>
				<div className={panelDetailClasses.column}>
					<SeriesDetails seriesDetails={props.tournamentDetails.series} />
				</div>
			</ExpansionPanelDetails>
		</div>
	);
};

export default TournamentsListItemDetail;
